    function cifradoVotante(uint256 _tokenID, address _minter, uint256 _ci) 
        public 
        pure 
        returns(uint256){
        uint256 combinedParams = _tokenID + uint160(_minter) + _ci;
        bytes memory encodedParams = abi.encodePacked(combinedParams);
        bytes32 hashedParams = keccak256(encodedParams);
        return uint256(hashedParams);
    }
}

